import React from 'react';
import { connect } from 'react-redux';


class PowerOnOff extends React.Component {
    render() {
        const { parOnOff, parChangeOnOff, onoff } = this.props;
        console.log(this.props);
        return <button className={`powerButton ${parOnOff ? 'powerOn' : 'powerOff'}`} onClick={parChangeOnOff}><i className="fas fa-power-off" /></button>
    }

}

const mapStateToProps = (state) => {
    return {
        onoff: state.onoff,
        etf: 213
    };
};

export default connect(mapStateToProps)(PowerOnOff);
